function Home({data}) {
  return (
    <>
      <h1>Minhas metas.</h1>
      
      <p>{data.metas}</p>
      {
        data.metas.map(meta=>{
          return (
            <div key={meta._id}>
              <h2>{meta.name}</h2>
              <p>{meta.description}</p>
              <p>{meta.status}</p>
              <hr />
            </div>
          )
        })
      }

    </>
  )
}

export async function getServerSideProps(){
  try {
    const response = await fetch(`http://localhost:8080/metas`);
    const data = await response.json();
    console.log(data);
    return {props:{data}}
  } catch (error) {
    return {
      notFound: true,
      error: `Dados não encontrados ${error}`
    } 
  }
  
}
export default Home
